function Home() {
  return (
    <div>
      <Header />
      <LoginHeader />
      <CreateArea />
      <CreateArea />
      <CreateArea />
      <Footer />
      <Router>
        <Route exact path="/anotherpage" element={ <AnotherPage /> }/>
      </Router>
    </div>
  );
}

export default Home;
